(100,'saas-code.json','DEFAULT_GROUP','{\n    \"maozi-cloud-base-code\": {\n        \"1\": {\n            \"code\": 1,\n            \"message\": \"\"\n        },\n        \"2\": {\n            \"code\": 2,\n            \"message\": \"服务没有此code\"\n        },\n        \"3\": {\n            \"code\": 3,\n            \"message\": \"Token错误\"\n        },\n        \"6\": {\n            \"code\": 6,\n            \"message\": \"服务未启动\"\n        },\n        \"7\": {\n            \"code\": 7,\n            \"message\": \"更新失败\"\n        },\n        \"8\": {\n            \"code\": 8,\n            \"message\": \"添加失败\"\n        },\n        \"9\": {\n            \"code\": 9,\n            \"message\": \"删除失败\"\n        },\n        \"10\": {\n            \"code\": 10,\n            \"message\": \"分页参数错误\"\n        },\n        \"11\": {\n            \"code\": 11,\n            \"message\": \"游客\"\n        },\n        \"12\": {\n            \"code\": 12,\n            \"message\": \"验签失败\"\n        },\n        \"13\": {\n            \"code\": 13,\n            \"message\": \"验证失败\"\n        },\n        \"14\": {\n            \"code\": 14,\n            \"message\": \"字段全部为空\"\n        },\n        \"16\": {\n            \"code\": 16,\n            \"message\": \"重复提交错误\"\n        },\n        \"17\": {\n            \"code\": 17,\n            \"message\": \"未找到第三方接口转换器\"\n        },\n        \"18\": {\n            \"code\": 18,\n            \"message\": \"未找到第三方数据请求转换器\"\n        },\n        \"400\": {\n            \"code\": 400,\n            \"message\": \"参数错误\"\n        },\n        \"401\": {\n            \"code\": 401,\n            \"message\": \"用户未授权\"\n        },\n        \"402\": {\n            \"code\": 402,\n            \"message\": \"恶意请求\"\n        },\n        \"403\": {\n            \"code\": 403,\n            \"message\": \"权限不足\"\n        },\n        \"404\": {\n            \"code\": 404,\n            \"message\": \"没有此资源\"\n        },\n        \"405\": {\n            \"code\": 405,\n            \"message\": \"请求格式错误\"\n        },\n        \"415\": {\n            \"code\": 415,\n            \"message\": \"请求格式错误\"\n        },\n        \"500\": {\n            \"code\": 500,\n            \"message\": \"内部服务错误\"\n        },\n        \"600\": {\n            \"code\": 600,\n            \"message\": \"错误熔断\"\n        },\n        \"601\": {\n            \"code\": 601,\n            \"message\": \"限流中\"\n        },\n        \"700\": {\n            \"code\": 700,\n            \"message\": \"网关错误\"\n        },\n        \"800\": {\n            \"code\": 800,\n            \"message\": \"获取Token失败\"\n        }\n    },\n    \"maozi-cloud-test-service-test-code\":{\n        \"3001\":{\n            \"code\":3001,\n            \"message\":\"测试测试\"\n        }\n    },\n    \"maozi-cloud-test-service-test-enums\":{\n\n        \"test-enums\":[{\n            \"key\": 0,\n            \"value\": \"test11\"\n        },{\n            \"key\": 1,\n            \"value\": \"test22\"\n        }]\n        \n    },\n    \"maozi-cloud-sso-service-oauthToken-rpc-code\":{\n        \"1001\":{\n            \"code\":1001,\n            \"message\":\"client无效\"\n        },\n        \"1002\":{\n            \"code\":1002,\n            \"message\":\"用户或密码错误\"\n        }\n    }\n}','d6eeafb40fe45564f55754adc9b9a69e','2023-02-20 01:04:02','2023-06-11 08:32:20','nacos','172.18.0.1','','','','','','json',''),
(102,'maozi-cloud-gateway.yml','DEFAULT_GROUP','application-port: 10000\n\napplication-project-name: gateway\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      # - name: Hystrix\n      #   args:\n      #     name: default\n      #     fallbackUri: forward:/gateway/fallback\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-SSO\n          uri: lb://maozi-cloud-sso\n          predicates:\n          - Path=/sso/**\n\n        - id: MAOZI-CLOUD-FORM\n          uri: lb://maozi-cloud-form\n          predicates:\n          - Path=/form/**\n\n        - id: MAOZI-CLOUD-PAY\n          uri: lb://maozi-cloud-pay\n          predicates:\n          - Path=/pay/**\n\n\n        - id: MAOZI-CLOUD-ORDER\n          uri: lb://maozi-cloud-order\n          predicates:\n          - Path=/order/**\n\n        - id: MAOZI-CLOUD-MESSAGE\n          uri: lb://maozi-cloud-message\n          predicates:\n          - Path=/message/**\n          filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n\n# hystrix:\n#   enabled: true\n#   shareSecurityContext: true\n#   command:\n#     default:\n#       execution:\n#         isolation:\n#           strategy: SEMAPHORE\n#           thread:\n#             timeoutInMilliseconds: 3000\n\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST\n\n\n\n\nknife4j:\n  gateway:\n    enable: true\n    routes:\n      - name: 系统服务\n        url: /user/v2/api-docs?group=default\n        service-name: maozi-cloud-user\n      - name: 授权服务\n        url: /sso/v2/api-docs?group=default\n        service-name: maozi-cloud-sso','dff11158d22038a37bccf49262761f72','2023-02-20 01:04:02','2023-06-07 01:03:10','nacos','172.18.0.1','','','','','','yaml',''),
