(0,792,'boot-log.xml','DEFAULT_GROUP','','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<configuration scan=\"true\" scanPeriod=\"60 seconds\">\r\n\r\n    <contextName>logback</contextName>\r\n    <statusListener class=\"ch.qos.logback.core.status.NopStatusListener\"/>\r\n    <conversionRule conversionWord=\"clr\" converterClass=\"org.springframework.boot.logging.logback.ColorConverter\" />\r\n    <conversionRule conversionWord=\"wex\" converterClass=\"org.springframework.boot.logging.logback.WhitespaceThrowableProxyConverter\" />\r\n    <conversionRule conversionWord=\"wEx\" converterClass=\"org.springframework.boot.logging.logback.ExtendedWhitespaceThrowableProxyConverter\" />\r\n	<conversionRule conversionWord=\"environment\" converterClass=\"com.maozi.log.convert.EnvironmentMessageConverter\" />\r\n	<conversionRule conversionWord=\"applicationName\" converterClass=\"com.maozi.log.convert.ApplicationNameMessageConverter\" />\r\n    <springProperty scope=\"context\" name=\"project.environment\" source=\"project.environment\"/>\r\n    <springProperty scope=\"context\" name=\"spring.application.name\" source=\"spring.application.name\"/>\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    <appender name=\"console-log\" class=\"ch.qos.logback.core.ConsoleAppender\">\r\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\r\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\r\n                <pattern>%clr([ %d{yyyy-MM-dd HH:mm:ss} ])  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\r\n            </layout>\r\n        </encoder>\r\n    </appender>\r\n\r\n\r\n    \r\n	<appender name=\"grpc-log\" class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.log.GRPCLogClientAppender\"></appender>\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    <!-- ALL -->\r\n    <appender name=\"all-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\r\n        <!-- 文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值-->\r\n        <file>log/log.log</file>\r\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\r\n            <!-- 文件名称 -->\r\n            <fileNamePattern>log/%d{yyyy-MM-dd}-log.log</fileNamePattern>\r\n            <!-- 文件最大保存历史数量 -->\r\n            <MaxHistory>30</MaxHistory>\r\n        </rollingPolicy>\r\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\r\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\r\n                <pattern>%clr([ %d{yyyy-MM-dd HH:mm:ss} ])  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ service：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  %clr([ %m ]){orange}%n</pattern>\r\n            </layout>\r\n        </encoder>\r\n    </appender>\r\n    \r\n    <!-- INFO -->\r\n    <!-- <appender name=\"info-log\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\r\n        文件路径 ，注意LOG_PATH是默认值,它的配置对应application.properties里的logging.path值\r\n        <file>${LOG_DIR:-.}/log/info/info.log</file>\r\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\r\n            文件名称\r\n            <fileNamePattern>log/info/info-%d{yyyy-MM-dd}.log</fileNamePattern>\r\n            文件最大保存历史数量\r\n            <MaxHistory>30</MaxHistory>\r\n        </rollingPolicy>\r\n        <encoder class=\"ch.qos.logback.core.encoder.LayoutWrappingEncoder\">\r\n            <layout class=\"org.apache.skywalking.apm.toolkit.log.logback.v1.x.TraceIdPatternLogbackLayout\">\r\n                <pattern>%clr(%d{yyyy-MM-dd HH:mm:ss})  %clr([ level：%level ]){blue}  %clr([ %tid ]){yellow}  %clr([ app：%applicationName ]){red}  %clr([ environment：%environment ]){greed}  